var assert = require('assert');
describe('Browserstack Login', function() {
    it('loging to https://www.browserstack.com/', function() {
        browser.url('https://www.browserstack.com/');
		browser.click('#primary-menu > li:nth-child(3) > a');
		browser.setValue('input[name="user[login]"]', 'fsejasm@gmail.com');
		browser.setValue('input[name="user[password]"]', 'Tester000@');
		browser.click('#user_submit');
		var pageUrl = browser.getUrl();
		assert.equal(pageUrl, 'https://www.browserstack.com/users/sign_in');
		assert.notEqual(pageUrl, 'https://www.browserstack.com/start');
	
    });
});